import React from "react";
import { Row, Col, Typography, Button } from "antd";
import { MinusOutlined, PlusOutlined } from "@ant-design/icons";

const Counter = () => {
  return (
    <React.Fragment>
      <Row>
        <Typography.Title>Counter Master-Blaster</Typography.Title>
      </Row>
      <Row>
        <Col md={9} />
        <Col md={2}>
          <Button size="large" icon={<LogoutOutlined />} shape="circle" />
        </Col>
        <Col md={2}>
          45
        </Col>
        <Col md={2}>
          <Button size="large" icon={<LogoutOutlined />} shape="circle" />
        </Col>
      </Row>
    </React.Fragment>
  );
};

export default Counter;
